import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal (simulate clicking cart icon)
    // Try to find the cart element by class
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal/dialog to appear (look for .cart-item or .cart-item-quantity)
    // Wait for either .cart-item or .empty-cart
    let cartHasItems = false;
    try {
      await page.waitForSelector('.cart-item', { timeout: 2000 });
      cartHasItems = true;
    } catch {
      // If .cart-item not found, check for empty cart
      await page.waitForSelector('.empty-cart', { timeout: 2000 });
      cartHasItems = false;
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    let extractedData = {};

    if (cartHasItems) {
      // Find the first cart-item's quantity span
      const cartItemSelector = '.cart-item';
      await page.waitForSelector(cartItemSelector, { timeout: 3000 });

      // Get current quantity
      const quantitySelector = '.cart-item-quantity .quantity';
      await page.waitForSelector(quantitySelector, { timeout: 3000 });
      const oldQuantity = await page.$eval(quantitySelector, el => Number(el.textContent.trim()));

      // Click the "+" button to increase quantity
      const plusBtnSelector = '.cart-item-quantity .quantity-btn:nth-of-type(2)';
      await page.click(plusBtnSelector);

      // Wait for quantity to update (simple wait for value to change)
      await page.waitForFunction(
        (sel, oldQty) => {
          const el = document.querySelector(sel);
          return el && Number(el.textContent.trim()) === oldQty + 1;
        },
        { timeout: 3000 },
        quantitySelector,
        oldQuantity
      );

      // Take screenshot after update
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

      // Extract updated quantity and cart total
      const newQuantity = await page.$eval(quantitySelector, el => Number(el.textContent.trim()));
      let cartTotal = null;
      try {
        cartTotal = await page.$eval('#cartTotal', el => el.textContent.trim());
      } catch {
        cartTotal = null;
      }

      extractedData = {
        oldQuantity,
        newQuantity,
        cartTotal
      };

      // Close cart modal if possible
      try {
        await page.click('button:has-text("Proceed to Checkout")');
      } catch {}

      return {
        success: true,
        action: "Updated cart item quantity by increasing it by 1",
        extractedData,
        screenshots,
        error: null
      };
    } else {
      // Cart is empty, nothing to update
      return {
        success: true,
        action: "Cart was empty, no item quantity to update",
        extractedData: { cartEmpty: true },
        screenshots,
        error: null
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
